import {FuseLoadable} from "owp/@fuse";

export const examplesConfig = {
    settings: {
        layout: {
            config: {}
        }
    },
    routes  : [
        {
            path     : '/examples/owpgrid',
            component: FuseLoadable({
                loader: () => import('./owpgrid')
            })
        },
        {
            path     : '/examples/owpbutton',
            component: FuseLoadable({
                loader: () => import('./owpbutton')
            })
        },
        {
            path     : '/examples/owpmessage',
            component: FuseLoadable({
                loader: () => import('./owpmessage')
            })
        },
        {
            path     : '/examples/owptabs',
            component: FuseLoadable({
                loader: () => import('./owptabs')
            })
        },
        {
            path     : '/examples/owpdrawer',
            component: FuseLoadable({
                loader: () => import('./owpdrawer')
            })
        },
        {
            path     : '/examples/owpautocomplate',
            component: FuseLoadable({
                loader: () => import('./owpautocomplate')
            })
        },
        {
            path     : '/examples/owppdf',
            component: FuseLoadable({
                loader: () => import('./owppdf')
            })
        }
    ]
};
